import About from "./About";
import Hero from "./home";
import Info from "./Info";
import BookAppointment from "./BookAppointment";
import Reviews from "../Components/Reviews";
import Doctors from "../Components/Doctors";


function Home() {
  return (
    <div >
      <Hero />
      <Info/>
      <About/>
      <BookAppointment/>
      <Doctors />
      <Footer />
    </div>
  );
}

export default Home;
